INSERT INTO `specifications` VALUES (1,'Hylas','',NULL,46,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-15 23:29:39','2009-03-19 21:26:46','Form and function combine with the keen eye and steady hand of renowned designer German Frers to produce this \"must-see\" cruising yacht. A true watertight collision bulkhead forward and another aft define the 46 as a serious offshore yacht. But it gets even better. Step below into a world of refined elegance, beautifully hand-finished teak furniture, splendid totally private comfort for two couples, plus room for up to three additional guests. Abundant storage, unsurpassed electrical and mechanical systems. Top-shelf hardware in every application. A fantastic seagoing galley worthy of a much larger yacht. In addition to a commanding specification that has been refined by thousands of miles at sea and the invaluable input of our many yacht owners, the Hylas 46 sparkles with a confident profile, a robust and modern sailplan, and a generous beam that carries well aft to provide both excellent stability and more interior volume than other yachts, all in just 46 feet. This may be all the boat you\'ll ever need! (hylasyachtsusa.com)'),(2,'Hylas','',NULL,49,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-15 23:42:23','2009-03-19 21:27:05','Her sweet sheer and elongated more traditional lines are the unmistakable hallmark of legendary yacht designers, Sparkman and Stephens. Known for her crisp performance and elegant hand-finished teak interior, she is an absolute joy to handle, even with small crew. The integrity assured by her solid laminate hull and watertight bulkheads further speak to her mission as a reliable offshore performer or elegant coastal cruiser. A feature-filled interior incorporates three double cabins, extraordinary in a 49-footer. The fully -equipped galley spans one of the two passageways to the aft stateroom. On deck, her deep and secure center cockpit provides perfect visibility from the helm and seats long enough to accommodate a relaxing nap. The reverse transom with wide steps and an integrated boarding ladder make getting aboard or off a breeze, whether from the water or from your dinghy. But the best part of her may be the delightfully positive helm that transmits her smooth energy to your fingertips... a spirited thoroughbred responding to your every command as the sea turns to diamonds, carrying you safely to your far destination.(hylasyachtsusa.com)'),(3,'Hylas','',NULL,54,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-15 23:53:40','2009-03-19 21:27:12','Available in two versions, the standard low profile coach roof and the raised saloon (RS) the Hylas 54 was the runaway winner of CRUISING WORLD Magazine\'s Boat of the Year contest for Full-Size Cruiser. It\'s no wonder. Her level of sophistication combined with ease of handling wins the approval of everyone who sees or sails her. Start with the TWARON(TM) reinforced solid glass hull (See the Construction section) and indulge yourself in the gleaming stainless steel deck hardware, the logically positioned winches, the angle of the cockpit seat back. It\'s all there: Clean decks, great visibility, and speed to rival race boats. Her magnificently proportioned Frers-designed hull is so slippery that owners report frequent 200-mile-plus days at sea. The smoothly sculpted deckhouse is beautifully proportioned, and the new RS version bathes the interior with light and a feeling of near infinite space. Her generous 15\'9\" beam is carried well aft, like her smaller sister, the 46, creating a more stable platform and greater interior volume.\r\n\r\nSpeaking of interiors, do you object to being spoiled? We couldn\'t possibly list all of the little details and touches incorporated into this yacht. Our thirty years of defining the most sailor-friendly charter boats have culminated in the creation of this three-stateroom, thoroughly modern beauty. The interior is so sumptuous you\'ll want to take off your shoes... but you don\'t have to. The finish is durable, the specification outstanding, performance astounding... and she\'s so easy to sail on and live aboard. Prepare to fall in love!  (hylasyachtsusa.com)'),(4,'Hylas','Raised Saloon',NULL,54,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-15 23:55:17','2009-03-19 21:27:19','Available in two versions, the standard low profile coach roof and the raised saloon (RS) the Hylas 54 was the runaway winner of CRUISING WORLD Magazine\'s Boat of the Year contest for Full-Size Cruiser. It\'s no wonder. Her level of sophistication combined with ease of handling wins the approval of everyone who sees or sails her. Start with the TWARON(TM) reinforced solid glass hull (See the Construction section) and indulge yourself in the gleaming stainless steel deck hardware, the logically positioned winches, the angle of the cockpit seat back. It\'s all there: Clean decks, great visibility, and speed to rival race boats. Her magnificently proportioned Frers-designed hull is so slippery that owners report frequent 200-mile-plus days at sea. The smoothly sculpted deckhouse is beautifully proportioned, and the new RS version bathes the interior with light and a feeling of near infinite space. Her generous 15\'9\" beam is carried well aft, like her smaller sister, the 46, creating a more stable platform and greater interior volume.\r\n\r\nSpeaking of interiors, do you object to being spoiled? We couldn\'t possibly list all of the little details and touches incorporated into this yacht. Our thirty years of defining the most sailor-friendly charter boats have culminated in the creation of this three-stateroom, thoroughly modern beauty. The interior is so sumptuous you\'ll want to take off your shoes... but you don\'t have to. The finish is durable, the specification outstanding, performance astounding... and she\'s so easy to sail on and live aboard. Prepare to fall in love!  (hylasyachtsusa.com)'),(5,'Hylas','Center Cockpit',NULL,44,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-17 20:43:15','2009-03-17 20:45:44',''),(6,'Hylas','Center Cockpit',NULL,47,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-17 20:43:51','2009-03-17 20:45:51',''),(7,'Hylas','Center Cockpit',NULL,51,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-17 20:44:15','2009-03-17 20:46:24',''),(8,'Hylas','',NULL,45,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-19 21:39:34','2009-03-19 21:39:34',''),(9,'Sabre','Mark I',NULL,38,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-19 22:01:41','2009-03-19 22:01:41',''),(10,'Sabre','Mark II',NULL,38,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-19 22:02:22','2009-03-19 22:02:22',''),(11,'Explorer','',NULL,47,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-19 22:06:04','2009-03-19 22:06:04',''),(12,'Allied','',NULL,42,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-19 22:06:55','2009-03-19 22:06:55',''),(13,'Amel','Rachel',NULL,48,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-19 22:07:53','2009-03-19 22:07:53',''),(14,'Amel','Maramu',NULL,48,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-19 22:14:07','2009-03-19 22:14:07',''),(15,'Amel','Super Maramu',2000,53,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-19 22:15:50','2009-03-19 22:15:50',''),(16,'Beneteau','Oceanis',NULL,43,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-19 22:17:48','2009-03-19 22:17:48',''),(17,'Beneteau','Oceanis Center Cockpit',NULL,44,'','',NULL,'','','','','','','','','','','','','','','','','',NULL,NULL,'2009-03-19 